class HeroObj {
    constructor(title, subTitle, text) {
        this.title = title;
        this.subTitle = subTitle;
        this.text = text;
    }
}

class TextBlockObj {
    constructor(title, text) {
        this.title = title;
        this.text = text;
    }
  }

  class MenuItemObj {
    constructor(value, id, path) {
        this.value = value;
        this.id = id;
        this.path = path;
    }
}
